import {
    UilChartPieAlt,
    UilShoppingCart,
    UilPricetagAlt,
    UilUsersAlt
} from "@iconscout/react-unicons"

// Sidebar Data
export const SidebarData = [
    {
      icon: UilChartPieAlt,
      heading: "Dashboard",
    },
    {
      icon: UilShoppingCart,
      heading: "Orders",
    },
    {
      icon: UilPricetagAlt,
      heading: "Customers",
    },
    {
      icon: UilUsersAlt,
      heading: 'Products'
    }
  ];
